// import pieChartData from "layouts/pages/charts/data/pieChartData";
// import radarChartData from "layouts/pages/charts/data/radarChartData";
// import polarChartData from "layouts/pages/charts/data/polarChartData";

// import MiniStatisticsCard from "examples/Cards/StatisticsCards/MiniStatisticsCard";
import { Table } from 'react-bootstrap';

function Charts() {

  return (


    <DashboardLayout>
      {/* <DashboardNavbar /> */}
      <SuiBox py={1}>
        <Grid container>
          <Grid item xs={12} lg={12}>
            <SuiBox mb={3} p={1}>
              <SuiTypography variant="h4" fontWeight="large" fontSize="1.6rem">
                <h4>
                  AUM (User Wise)
                  <a href="/holding/ amcwiseaum">AUM (AMC Wise)</a>
                  <a href="/holding/ schemety.peamc"> AUM (Scheme Type Wise)</a>
                  <a href="/holding/ schemewise"> AUM (Scheme Wise)  </a>
                  <a href="/holding/ userwiseaum"> AUM (RTA wise) </a>
                </h4>
              </SuiTypography>
            </SuiBox>
          </Grid>
          <Grid item xs={15} lg={12} py={.05}>
            <SuiBox mb={3}>
            <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
              <thead>
                <tr>
                  <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>PAN Number</th>
                  <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>User</th>
                  <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Invested Amount</th>
                  <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Current Amount</th>
                  <th style={{ backgroundColor: "rgb(249, 221, 171)", padding: "15px" }}>Details</th>
                </tr>
              </thead>
              <tbody>
                <tr>
                  <td style={{ Color: "#038d8a", padding: "10px" }}>AEGPA6692G	</td>
                  <td>ABHA AGARWAL</td>
                  <td>7,50,000</td>
                  <td>11,20,492</td>
                </tr>
                <tr>
                  <td style={{ Color: "#038d8a", padding: "10px" }}>ABGFA5273N</td>
                  <td>AGARWAL BUILDCON</td>
                  <td>2,00,000</td>
                  <td>3,02,603</td>
                </tr>
                <tr>
                  <td style={{ Color: "#038d8a", padding: "10px" }}>ADKPK5813A</td>
                  <td>ANAND KUMAR SABOO</td>
                  <td>55,06,342</td>
                  <td>57,40,306</td>
                </tr>
                <tr>
                  <td style={{ Color: "#038d8a", padding: "10px" }}>ADKPK5813A</td>
                  <td>ANAND KUMAR SABOO</td>
                  <td>2,47,82,266</td>
                  <td>3,36,14,360</td>
                </tr>
                <tr>
                  <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}> Total</td>
                  <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>---</td>
                  <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>12,87,62,505</td>
                  <td style={{ fontWeight: "900", backgroundColor: "#ddd" }}>15,33,16,151</td>
                </tr>
              </tbody>
            </Table>
            </SuiBox>
          </Grid>
        </Grid>
      </SuiBox>
    </DashboardLayout>
  );
}

export default Charts;
